/* VCD dumping functions */
MOD_mkmulticore & mkmulticore_backing(tSimStateHdl simHdl)
{
  static MOD_mkmulticore *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkmulticore(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkmulticore::dump_VCD_defs()
{
  (mkmulticore_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkmulticore::dump_VCD(tVCDDumpType dt)
{
  (mkmulticore_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkmulticore_backing(sim_hdl));
}
